    false,nt"url": null,nt"notes": "This annual narrative report for Arctic
    NWR outlines Refuge accomplishments during the 1974 fiscal year. The report begins
    by summarizing the weather conditions during the year. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
    fish, and diseases- is also covered. The Refuge development and maintenance section
    discusses physical developments. Resource management is outlined; topics include
    fur harvesting. A progress report on field investigations and applied research is
    also provided. The public relations section of the report describes recreational
    uses.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
